    margin-right: -10px; /* Adjust this to control the space between "T" and mirrored "R" */
`;

const MirroredR = styled.span`
    transform: scaleX(-1);
    display: inline-block;
`;

                                                
const Logo = () => {
    return(
    <Container>
        <Text>CULTR</Text>
    </Container>
    );   
}

